import React from 'react';
import './Profile.css';

import 'tachyons';

const Profile = ({ appState }) => {
    return(
        <div className="profile-container flex flex-column pa2 tc">
            <div> {appState.userProfile.name} </div>

        </div>
    )
}


export default Profile;
